import React from 'react';
import PageTemplate from '../../templates/PageTemplate';
import { Header } from '../../components/organism';
import { MyPokemonList } from '../../containers'

const MyPokemon = () => {
    return (
        <PageTemplate
            header={<Header/>}>
            <MyPokemonList/>
        </PageTemplate>
    )
}

export default MyPokemon;
